import { fs } from "@llamaindex/env";
import { Document } from "../Node.js";
/**
 * Read a .txt file
 */ export class TextFileReader {
    async loadData(file) {
        const dataBuffer = await fs.readFile(file, "utf-8");
        return [
            new Document({
                text: dataBuffer,
                id_: file
            })
        ];
    }
}
